INSERT INTO `fiainana` VALUES (32,'Behold zanaku','<p>Behold the Father\'s heart</p><p>The mystery He lavishes on us</p><p>As deep cries out to deep</p><p>Oh, how desperately He wants us</p><p>The things of earth stand next to Him</p><p>Like a candle to the sun</p><p>Unfailing Father</p><p>What compares to His great love</p><p>Behold His holy Son</p><p>The Lion and the Lamb given to us</p><p>The Word became a man</p><p>That my soul should know its Savior</p><p>Forsaken for the sake of all mankind</p><p>Salvation is in His blood</p><p>Jesus Messiah</p><p>The righteous died for love</p><p>It wasn\'t over</p><p>For He is the risen one</p><p>Then sings my soul</p><p>Then sings my soul</p><p>How great Your love is</p><p>How great Your love is</p><p>Then sings my soul</p><p>Then sings my soul</p><p>How great Your love is</p><p>How great Your love is</p><p>Then sings my soul</p><p>Behold I have a friend</p><p>The Spirit breathing holy fire within</p><p>My ever present help</p><p>Speaking truth when I can\'t find it</p><p>Light up this broken heart and light my way</p><p>\'Til my time on earth is done</p><p>Oh, Holy Spirit</p><p>Breathe in me like Kingdom come</p><p>Oh, Holy Spirit</p><p>Let Your work in me be done</p><p>Then sings my soul</p><p>Then sings my soul</p><p>How great Your love is</p><p>How great Your love is</p><p>Then sings my soul</p><p>Then sings my soul</p><p>How great Your love is</p><p>How great Your love is</p><p>Then sings my soul</p><p>Then sings my soul</p><p>How great Your love is</p><p>How great Your love is</p><p>Then sings my soul</p><p>My God</p><p>He who was and is to come</p><p>Prepare the way</p><p>Until the work on earth is done</p><p>Watch as the clouds He rides swing low</p><p>Lift up the sound as He makes our praise His throne</p><p>Behold the Lord our God will lead us Home</p>','2020-01-01 09:37:41','2020-01-01 09:37:00','http://localhost:8000/uploads/photos/3688833-5e0cd5eded8f6.jpeg',1);
